import * as types from './types';
import { reduxRequest as request } from 'services/Api';
import { withVariables } from 'utils/string';
import { ENDPOINT_PUBLIC_USER_EFFECTS, ENDPOINT_PUBLIC_USER_EFFECT } from 'consts/api';
export const list = params => (dispatch, getState) => {
  return dispatch(request({
    getState,
    reduxType: types.LIST,
    method: 'GET',
    path: withVariables(ENDPOINT_PUBLIC_USER_EFFECTS, params),
    params,
    requestParams: params
  })).catch(error => {
    console.error(error);
    throw error;
  });
};
export const single = params => (dispatch, getState) => {
  return dispatch(request({
    getState,
    reduxType: types.SINGLE,
    method: 'GET',
    path: withVariables(ENDPOINT_PUBLIC_USER_EFFECT, params),
    params
  })).catch(error => {
    console.error(error);
    throw error;
  });
};
